import React from "react";
import { Carousel } from "react-bootstrap";
import img1 from "../assets/1.png";
import img5 from "../assets/5.png";

const HomePage = () => {
  return (
    <Carousel>
      <Carousel.Item interval={1000}>
        <img
          id="homeImg"
          className="d-block w-100"
          src={img1}
          alt="First slide"
        />
      </Carousel.Item>

      <Carousel.Item>
        <img
          id="homeImg"
          className="d-block w-100"
          src={img5}
          alt="Third slide"
        />
      </Carousel.Item>
    </Carousel>
  );
};

export default HomePage;
